import React from 'react';

const Header = ({course}) => {
    return <h1>{course.name}</h1>
};

const Part = ({part}) => {
    return <p key={part.id}>{part.name} {part.exercise}</p>
};

const Content = ({course}) => {
    return <div>
                {course.parts.map((part) => 
                    <Part part={part}/>
                )}
            </div>
}


const Course = ({course}) => {
    return ( 
        <div>
            {course.parts.map((part) => 
                <p key={part.id}>{part.name} {part.exercises}</p>
            )}
            <p>total of {course.parts.reduce((sum, part) => sum + part.exercise, 0)}</p>
        </div>
    )
}

export default Course;
